import { FormGroup,FormControl, InputLabel,Input,Typography,styled} from "@mui/material";



const Container = styled(FormGroup)`
width:50%;
margin:5% auto 0 auto;
& > div{
    margin-top:20px
}
`
const  AddUser = ()=>{
    return(
        <Container>
            <Typography variant="h4">Add User</Typography>
            <FormControl>
                <InputLabel>Name</InputLabel>
                <Input/>
            </FormControl>
            <FormControl>
                <InputLabel>UserName</InputLabel>
                <Input/>
            </FormControl>
            <FormControl>
                <InputLabel>Email</InputLabel>
                <Input/>
            </FormControl>
            <FormControl>
                <InputLabel>Phone</InputLabel>
                <Input/>
            </FormControl>
        </Container>
    )
}
export default AddUser;
